import React, { useState } from "react";

import FormPrescoring from "./Form/FormPrescoring";
import Offer from "./Form/Offer";

function Form() {
  const [page, setPage] = useState(0);

  const PageDisplay = () => {
    if (page === 0) {
        return <FormPrescoring />
    } else if (page === 1){
        return <Offer />
    } else {
        return <Result />
    }
  };

   return (
    <>
      <div className="body-form">{PageDisplay()}</div>
      <div className="footer-form">
        <button
          onClick={() => {
            setPage((currPage) => currPage + 1);
          }}
        >
          Continue
        </button>
      </div>
    </>
  );
}

export default Form;
